description:
How It Works was the 6th release from Australian punk-rock group Bodyjar. The single from the album &quot;Not the Same&quot; was used by Pepsi in an advertising campaign in Australia. It was also used in the video game Tony Hawk's Pro Skater 3. It also featured in the video game MX Superfly.
It reached gold status in 2005. Along with Bodyjar's other EMI album Plastic Skies, it is now out of print.

